import React, { useEffect, useState } from 'react';
import { getUserBookings, updateBooking, deleteBooking } from '../services/bookingService';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

function ManageAppointments() {
  const [bookings, setBookings] = useState([]);
  const [editingId, setEditingId] = useState(null);
  const [newDate, setNewDate] = useState('');
  const [availableSlots, setAvailableSlots] = useState([]);
  const [newTime, setNewTime] = useState('');

  const navigate = useNavigate();
  const token = localStorage.getItem('token');

  useEffect(() => {
    if (!token) {
      alert('Please login first!');
      navigate('/login');
      return;
    }

    getUserBookings(token)
      .then(setBookings)
      .catch(console.error);
  }, [token, navigate]);

  const handleEdit = (booking) => {
    setEditingId(booking.id);
    setNewDate(booking.date);
    setNewTime(booking.time.slice(0,5));
    setAvailableSlots([]);
  };

  const handleDateChange = async (e) => {
    const selectedDate = e.target.value;
    setNewDate(selectedDate);

    const b = bookings.find(b => b.id === editingId);
    if (b && b.service_id && b.provider_id) {
      try {
        const res = await axios.get(`http://localhost:5000/availability?provider_id=${b.provider_id}&service_id=${b.service_id}&date=${selectedDate}`, {
          headers: { Authorization: `Bearer ${token}` }
        });
        setAvailableSlots(res.data);
        setNewTime(''); // reset the time since we have new slots
      } catch (err) {
        console.error(err);
        alert('Failed to fetch new availability');
      }
    }
  };

  const handleUpdate = async () => {
    await updateBooking(editingId, newDate, newTime, token);
    const updated = await getUserBookings(token);
    setBookings(updated);
    setEditingId(null);
    setAvailableSlots([]);
  };

  const handleCancel = async (id) => {
    if (window.confirm('Are you sure you want to cancel this appointment?')) {
      await deleteBooking(id, token);
      const updated = await getUserBookings(token);
      setBookings(updated);
    }
  };

  return (
    <div style={{maxWidth:'500px', margin:'50px auto'}}>
      <h2>My Appointments</h2>
      {bookings.length === 0 && <p>You have no upcoming appointments.</p>}
      {bookings.map(b => (
        <div key={b.id} style={{border:'1px solid #ccc', padding:'10px', marginBottom:'10px'}}>
          {editingId === b.id ? (
            <div>
              <p>Service: {b.service_name}</p>
              <label>New Date: </label>
              <input 
                type="date" 
                value={newDate} 
                onChange={handleDateChange} 
              />
              {availableSlots.length > 0 && (
                <>
                  <label>New Time: </label>
                  <select value={newTime} onChange={e => setNewTime(e.target.value)}>
                    <option value="">-- Select Time --</option>
                    {availableSlots.map((slot, index) => (
                      <option key={index} value={slot}>{slot}</option>
                    ))}
                  </select>
                </>
              )}
              <button onClick={handleUpdate} disabled={!newDate || !newTime}>Save</button>
              <button onClick={() => {setEditingId(null); setAvailableSlots([]);}}>Cancel</button>
            </div>
          ) : (
            <div>
              <p>Service: {b.service_name}</p>
              <p>Date: {b.date}</p>
              <p>Time: {b.time}</p>
              <p>Status: {b.status}</p>
              <button onClick={() => handleEdit(b)}>Reschedule</button>
              <button onClick={() => handleCancel(b.id)}>Cancel</button>
            </div>
          )}
        </div>
      ))}
    </div>
  );
}

export default ManageAppointments;
